import React, { useState, useEffect } from "react";
import ClipLoader from "react-spinners/ClipLoader";
import { useDispatch, useSelector } from "react-redux";
import activities from "../../styles/activitiesStyle";
import Options from "./options";
import {
  activitiesAction,
  getEarnings as getEarningsData,
  getExpenses as Expences,
} from "../../redux/actions/actionCreator";
import icon from "../../images/more-512.webp";

const Activities = (props) => {
  const [state, setState] = useState({ active: false });
  const dispatch = useDispatch();

  const select = useSelector((e) => {
    return e;
  });

  const override = `
    display: block;
    margin: 0 auto;
    border-color: black;
    margin-top: 160px;
        `;

  useEffect(() => {
    dispatch(activitiesAction(props));
  }, [dispatch, props]);

  const getEarnings = () => {
    dispatch(getEarningsData(props));
  };

  const getAllTransacrtions = () => {
    dispatch(activitiesAction(props));
  };

  const getExpenses = () => {
    dispatch(Expences(props));
  };

  const getDate = (e) => {
    let date = new Date(e);
    return date.toDateString();
  };

  const displayOption = () => {
    setState((prevState) => ({
      ...prevState,
      active: !state.active,
    }));
  };

  return <div>Hello Recent</div>;
};

export default Activities;
